import React from 'react'

import { Container , Label} from './styles'

export default function Card() {
  return (
    <Container>
      <header>
        <Label color="#7159c1" />
      </header>
      <p>Fazer migração completa do servidor</p>
      <img src="https://avatars.githubusercontent.com/u/72111010?v=4" alt="" />
    </Container>
  )
}
